pragma solidity ^0.8.28;

import {ERC20} from "https://github.com/transmissions11/solmate/blob/main/src/tokens/ERC20.sol";

contract Guano is ERC20  {
    constructor() ERC20("Guano","GUA",18) {}

    
}

